text:
Systemic capillary leak syndrome (SLCS) has recently been reported as a very rare adverse effect of adenoviral vector #COVID19 vaccines. People with a history of SCLS are more likely to experience this adverse effect. 
Details: https://t.co/lkPSO0A2mf

